      "module_uoa": "bc0409fb61f0aa82"
    }, 
    {
      "repo_uoa": "9a3280b14a4285c9", 
      "point_uid": "e299dd54f219ef4a", 
      "data_uoa": "3060946abb22a8db", 
      "features": {
        "##choices#compiler_flags#param_selsched_max_sched_times": "--param selsched-max-sched-times=3", 
        "##choices#compiler_flags#base_opt": "-Os", 
        "##choices#compiler_flags#fipa_pta": "-fipa-pta", 
        "##choices#target_os": "linux-32", 
        "##choices#compiler_flags#fdse": "-fdse", 
        "##choices#compiler_flags#fgcse_sm": "-fno-gcse-sm", 
        "##choices#compile_type": "dynamic", 
        "##choices#cmd_key": "cmd1", 
        "##choices#data_uoa": "slambench-1.1-cpu", 
        "##choices#compiler_flags#fstrict_aliasing": "-fstrict-aliasing", 
        "##choices#compiler_flags#ftree_reassoc": "-ftree-reassoc", 
        "##choices#device_id": "", 
        "##choices#compiler_flags#param_max_grow_copy_bb_insns": "--param max-grow-copy-bb-insns=15", 
        "##choices#host_os": "linux-32", 
        "##choices#dataset_uoa": "slambench-living-room-traj2-loop-1frame", 
        "##choices#repeat": 200, 
        "##choices#compiler_flags#param_omega_max_wild_cards": "--param omega-max-wild-cards=61", 
        "##choices#target_os_bits": "32", 
        "##choices#module_uoa": "b0ac08fe1d3c2615"
      }, 
      "module_uoa": "bc0409fb61f0aa82"
    }
  ]
};

var xps={
  "1": {
    "color": "#9f3f3f", 
    "type": "rect", 
    "size": 5
  }, 
  "0": {
    "color": "#3366cc", 
    "size": 4
  }, 
  "3": {
    "color": "#00af00", 
    "type": "rect", 
    "size": 5
  }, 
  "2": {
    "color": "#dc3912", 
    "size": 4
  }
};

// setup x 
var xValue = function(d) { return d.x;}, // data -> value
    xScale = d3.scale.linear().range([0, width]), // value -> display
    xMap = function(d) { return xScale(xValue(d));}, // data -> display
    xAxis = d3.svg.axis().scale(xScale).orient("bottom");

// setup y
var yValue = function(d) { return d.y;}, // data -> value
    yScale = d3.scale.linear().range([height, 0]), // value -> display
    yMap = function(d) { return yScale(yValue(d));}, // data -> display
    yAxis = d3.svg.axis().scale(yScale).orient("left");

// add the graph canvas to the body of the webpage
var svg = d3.select("$#ck_where#$").append("svg")
            .attr("width", width + margin.left + margin.right)
            .attr("height", height + margin.top + margin.bottom)
            .append("g")
            .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

// add the tooltip area to the webpage
var tooltip = d3.select("$#ck_where#$").append("div")
                .attr("class", "tooltip")
                .style("opacity", 0);


/* Check min/max on all axis */
pxmin="50000";
pxmax="150000";
pymin="1";
pymax="4";

xmin=-1;
xmax=-1;
ymin=-1;
ymax=-1;

var data;
var adata=[];
var sgraph;
var ps;

for (graph=0; graph < 100; graph++) {

   sgraph=graph.toString();

   if (!(sgraph in xdata)) break;

   data=xdata[sgraph];

   for (l=0; l<data.length; l++)
   {
     v=data[l];

     if (pxmin=="" && (xmin==-1 || v[0]<xmin)) xmin=v[0];
     if (pxmax=="" && (xmax==-1 || v[0]>xmax)) xmax=v[0];

     if (pymin=="" && (ymin==-1 || v[1]<ymin)) ymin=v[1];
     if (pymax=="" && (ymax==-1 || v[1]>ymax)) ymax=v[1];
   }
}

if (pxmin!="") xmin=parseFloat(pxmin);
if (pxmax!="") xmax=parseFloat(pxmax);
if (pymin!="") ymin=parseFloat(pymin);
if (pymax!="") ymax=parseFloat(pymax);

// don't want dots overlapping axis, so add in buffer to data domain
xScale.domain([xmin, xmax]);
yScale.domain([ymin, ymax]);

// x-axis
svg.append("g")
   .attr("class", "x axis")
   .attr("transform", "translate(0," + height + ")")
   .call(xAxis)
   .append("text")
   .attr("class", "label")
   .attr("x", width)
   .attr("y", -6)
   .style("text-anchor", "end")
   .text("Binary file size (bytes)");

// y-axis
svg.append("g")
   .attr("class", "y axis")
   .call(yAxis)
   .append("text")
   .attr("class", "label")
   .attr("transform", "rotate(-90)")
   .attr("y", 6)
   .attr("dy", ".71em")
   .style("text-anchor", "end")
   .text("Whole execution time, expected value (sec.)");

// Convert to internal format
for (graph=0; graph < 100; graph++) {

   sgraph=graph.toString();

   if (!(sgraph in xdata)) break;

   data=xdata[sgraph];
   ps=xps[sgraph];
   info=xinfo[sgraph];

   for (q=0; q<data.length; q++)
   {
     var cid=info[q]['module_uoa']+':'+info[q]['data_uoa'];

     var features=info[q].features;
     var sfeatures="";
     
     var keys=[];
     for (var key in features) {
       if (features.hasOwnProperty(key)) {
          keys.push(key);
       }
     }
     keys.sort();

     for (k=0; k<keys.length; k++)
     {
       key=keys[k];
       sfeatures+=key+'='+features[key]+'<br>';
     }

     adata.push({"x":data[q][0], "y":data[q][1], "size":ps.size, "type":ps.type, "color":ps.color, "cid":cid, "subpoint":info[q].point_uid, 
                 "info":info[q], "features":sfeatures})
   }
}

// draw dots
svg.selectAll(".dot")
   .data(adata)
   .enter()

   .append("circle")
   .attr("r", function(d) {return d.size})
   .attr("cx", xMap)
   .attr("cy", yMap)
   .style("fill", function(d) {return d.color})

   .on("click", function(d) {
     window.open("$#ck_root_url#$wcid="+d.cid+'&subpoint='+d.subpoint);
   })


   .on("mouseover", function(d) {
       tooltip.transition()
            .duration(200)
            .style("opacity", .9);
       tooltip.html("<div style=\"text-align:left;background-color:yellow;opacity:0.8;filter:alpha(opacity=80);\"><small><b>x=" + xValue(d) + ", y=" + yValue(d) + "</b><br>"+d.features+"\n</small></div>")
            .style("left", (d3.event.pageX + 5) + "px")
            .style("top", (d3.event.pageY - 28) + "px");
   })

   .on("mouseout", function(d) {
       tooltip.transition()
            .duration(500)
            .style("opacity", 0);
   });

</script>
